import './header.css';
import {usePages} from "../../hooks/usePages/Usepages";

import {
    BrowserRouter as Router, 
    Link,
  } from "react-router-dom";


function HeaderMain() {
    
    const {isOrganizationPage,
        isOrganizationList,
        isHome,gotolist}= usePages();

    const searchHandler = (e) =>{
        if(e.key === 'Enter'){
            const search = e.target.value;
            gotolist(search);
        }

    }


    return (
        <div className="header just_AR">
            
            {isHome && (<h1>HOME</h1>)}
            {isOrganizationPage && (<h1>ORGANIZATION</h1>)} 
            {isOrganizationList && (<h1>LIST ORGANIZATION</h1>)} 
            {<input type="text" placeholder="search" onKeyPress={searchHandler}></input>}
            {isOrganizationPage && (<button onClick={e=>gotolist()}>Back</button>)} 
            {isOrganizationList && (<Link to="/recipes/new"><p>Create</p></Link>)} 
             
        </div>
    );
}



export default HeaderMain;
